script: |
  super -f tsv -I q1366.sql | sort > q1366.out

vector: true

inputs:
  - name: q1366.sql
    data: |
      SELECT d-e,
      a,
      b
      FROM t1
      WHERE d NOT BETWEEN 110 AND 150
      AND (e>a AND e<b);
  - name: t1

outputs:
  - name: q1366.out
    data: |
      -2	191	194
      1	220	223
      2	245	249
